import React from 'react';
import Heading from './heading/Heading.js';
import Experience from './experience/Experience.js';
import Contact from './contact/Contact.js';
import './App.css';

function App() {
  return (
    <div className="App">
      <Heading />
      <Experience />
      <section className="fun">
        <h2>Fun things</h2>
        <div className="fun-example">
          <img src="http://placekitten.com/g/200/300" alt="placeholder"></img>
          <p>tiny rocket game</p>
        </div>
      </section>
      <Contact />
    </div>
  );
}

export default App;
